import React, {useState} from "react";

function Deck({deckSet}){
  console.log(deckSet)

  const result = deckSet.map(deck => (
      <div className="card">
        <div className="card-body">
          <h3 className="card-title">
            {deck.name}
          </h3>
          <p className="card-text">
            {deck.description}
          </p>
        </div>
      </div>
  ));

  return(
    <>
      {result}
    </>
  )
}


export default Deck;
